 To terminate a C program, you typically use the `exit()` function provided by the C standard library. This function should be called with an integer argument that specifies the exit status. For example, `exit(0)` would indicate that the program has ended successfully, while `exit(1)` would indicate an error.

Here's a simple example of how you might use `exit()` in a program:

```c
#include <stdlib>

int main() {
    // Your program code here

    // Exit the program
    exit(0);
}
```

In this example, the program will terminate immediately after the `exit()` call, and the argument to `exit()` will be returned as the program's exit status.
